import dash from "./img/dash.svg";
import "./SideNavbar.css";
import bank from './img/bank-building@2x 1.svg'

const SideNavbar = () => {
    const [isExpended, setExpendedState] = useState(false)
  return (
    <div className={isExpended? "side-nav-container" : "side-nav-container side-nav-container-NX"}>
      <div className="nav-upper">
        <div className="nav-heading">
          <div className="nav-brand">
            <img src={bank} alt="" />
          </div>
          <button className={isExpended ? "hamburger hamburger-in" : "hamburger hamburger-out"
        }
        onClick={() => (
            setExpendedState(!isExpended)
        )}
        >
            <span></span>
            <span></span>
            <span></span>
          </button>
        </div>
      </div>
    </div>
  );
};

export default SideNavbar;
